var lines = ["",
"",
"",
"",
""];

// lines = ["ULL",
// "RRDDD",
// "LURDL",
// "UUUUD"];

var row = 3, col = 0;
var pad = [
  ['X','X','1','X','X'],
  ['X','2','3','4','X'],
  ['5','6','7','8','9'],
  ['X','A','B','C','X'],
  ['x','X','D','X','X']
]
var solution = "";

lines.forEach((line) => {
  var steps = line.split("");
  steps.forEach((step) => {
    switch (step) {
      case 'U':
        if (pad[row-1]) {
          if(pad[row-1][col] && pad[row-1][col] != 'X') {
            row-=1
          }
        }
        break;
      case 'D':
        if (pad[row+1]) {
          if(pad[row+1][col] && pad[row+1][col] != 'X') {
            row+=1
          }
        }
        break;
      case 'L':
        if (pad[row][col-1] && pad[row][col-1] != 'X') {
          col-=1
        }
        break;
      case 'R':
        if (pad[row][col+1] && pad[row][col+1] != 'X') {
          col+=1
        }
        break;
    }
  });
  solution = solution + pad[row][col];
}); 
console.log(solution);